import React from "react";
import { ACTIONS } from "./App";

/* Encapsulate DigitButton as components */
export default function ClearButton({ dispatch, digit, children, className }) {
	return (
		<button
			className={className}
			children={children}
			onClick={() => dispatch({ type: ACTIONS.CLEAR })}
		/>
	);
}
